import { useCallback } from 'react';
import { Handle, Position } from 'reactflow';

function DatasetNode({ data }) {
  const onChange = useCallback((evt) => {
    console.log(evt.target.value);
  }, []);

  return (
    <div className="dataset-node">
      <div>
        <label htmlFor="text">DATASET</label>
        <div className='dataset-node_selectiondiv'>
          <input type="radio" id="provided" value="provided" checked/>
          <p>Provided</p>
        </div>
        <select className='dataset-node_select' onChange={onChange}>
          <option hidden selected>Choose a Dataset</option>
          <option>IRIS Dataset</option>
          <option>MNIST Dataset</option>
        </select>
      </div>
      <Handle type="source" position={Position.Right} id="b"/>
    </div>
  );
}

export default DatasetNode;
